DROP TABLE IF EXISTS `settle_pact`;
CREATE TABLE `settle_pact` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `agreement_no` varchar(20) NOT NULL COMMENT '合同流水号',
  `agreement_code` varchar(20) NOT NULL COMMENT '合同编号',
  `agreement_category` char(1) DEFAULT NULL COMMENT '合同分类[1:供货商合同，2:采购合同，3:联名卡合同]',
  `merchant_no` varchar(20) NOT NULL COMMENT '商户号',
  `merchant_name` varchar(100) DEFAULT NULL,
  `agreement_time` datetime NOT NULL COMMENT '签订时间',
  `validate_start` date NOT NULL COMMENT '有效开始时间',
  `validate_end` date NOT NULL COMMENT '有效结束时间',
  `agreement_type` char(1) DEFAULT NULL COMMENT '合同类型[0:平台自营代销2046，1:平台商城模式2016]',
  `interface_type` char(1) DEFAULT NULL COMMENT '是否调用商户接口[0:是,1:否,]',
  `account_type` char(1) DEFAULT NULL COMMENT '账户类型[0:银行账户,1:快钱账户,]',
  `commission_rate` varchar(10) DEFAULT NULL COMMENT '佣金费率',
  `bank_no` varchar(50) DEFAULT NULL COMMENT '银行账户账号',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '银行名称',
  `bank_account_name` varchar(50) DEFAULT NULL COMMENT '银行账户户名',
  `sub_bank_name` varchar(50) DEFAULT NULL COMMENT '所属支行',
  `easymoney_account_no` varchar(50) DEFAULT NULL COMMENT '快钱账户账号',
  `easymoney_account_name` varchar(50) DEFAULT NULL COMMENT '快钱账户账号名称',
  `settle_type` char(1) NOT NULL COMMENT '结算周期[0:T+1,1:按月结算,]',
  `settle_day` int(2) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `bank_city` varchar(20) DEFAULT NULL COMMENT '银行所在城市',
  `business_type` char(1) NOT NULL COMMENT '业务类型[1:卡券B2C，2:积分B2C, 3:联名卡]',
  `netting_type` char(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=218 DEFAULT CHARSET=utf8 COMMENT='合同信息表，对应： idc_exchange.dr_agreement_info';

